import React from 'react';

class ViewBuilding extends React.Component {

	render() {
		const building = this.props.data
		.filter(name=>{
            return name.id == this.props.selectedBuilding
        })
		.map(id=>{
			if(id.coordinates){
				return(
					<div>
						<p>Building name: {building.name}</p>
						<ul>
							<li>Code: {building.code}</li>
							<li>Address: {building.address}</li>
							<li>Latitude: {building.coordinates.latitude}</li>
							<li>Longitude: {building.coordinates.longitude}</li>

						</ul>
					</div>
				)
			}
			else{
				return(
					<div>
						<p>Building name: {building.name}</p>
						<ul>
							<li>Code: {building.code}</li>
							<li>Address: {building.address}</li>
						</ul>
					</div>
				)
			}
		})
		console.log(this.props.selectedBuilding)
		return (
			<div>
				<p>
					{' '}
					<i>Click on a name to view more information</i>
					{building}	

				</p>
			</div>
		);
	}
}
export default ViewBuilding;
